var gt3rs =
    "data:image/jpeg;base64,"
var lambo =
    "data:image/jpeg;base64,";
var mclaran =
    "data:image/jpeg;base64,";
var m5 = "https://www.carscoops.com/wp-content/uploads/2019/05/708f623b-bmw-m5-power-.jpg";

var tesla = "data:image/jpeg;base64,"
var car1 = "data:image/jpeg;base64,"
var car2 = "https://i.ytimg.com/vi/kW3I6ICayeU/maxresdefault.jpg";
var car3 = "data:image/jpeg;base64,"
var car4 = "data:image/jpeg;base64,"

document.getElementById("car1").src = car1;
document.getElementById("car2").src = car2;
document.getElementById("car3").src = car3;
document.getElementById("car4").src = car4;
var picList = [gt3rs, mclaran, m5, tesla, lambo, car1, car2, car3, car4];
var set = new Set();
set.add(car1);
set.add(car2);
set.add(car3);
set.add(car4);
document.querySelectorAll(".vid").forEach((e) => {
    e.addEventListener("mouseover", () => {
        var index = Math.floor(Math.random() * picList.length);
        while (set.has(picList[index])) {
            index = Math.floor(Math.random() * picList.length);

        }
        set.delete(e.src);
        set.add(picList[index]);
        e.src = picList[index];
    });
});

